import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Button, Form, Upload, Input } from 'antd'
import { UploadOutlined } from '@ant-design/icons';

const formItemLayout = {
    labelCol: { span: 6 },
    wrapperCol: { span: 14 },
};

const normFile = (e) => {
    console.log('Upload event:', e);
    if (Array.isArray(e)) {
      return e;
    }
    return e && e.fileList;
};

const onFinish = (values) => {
    console.log('Received values of form: ', values);
};

class GISubmit extends Component {

    render() {
        const title = 'Submit Global International Mobility Proxy Forms';

        return (
            <Form name="validate_other" {...formItemLayout} onFinish={onFinish}>
                <Form.Item label="Type">
                    <span className="ant-form-text">{title}</span>
                </Form.Item>
                <Form.Item
                    name="upload"
                    label="Upload"
                    valuePropName="fileList"
                    getValueFromEvent={normFile}
                    extra="Only .csv is supported"
                >
                    <Upload name="logo" action="/upload.do" listType="text" maxCount={1}>
                        <Button icon={<UploadOutlined />}>Click to upload</Button>
                    </Upload>
                </Form.Item>

                <Form.Item name={['user', 'introduction']} label="Comments">
                    <Input.TextArea />
                </Form.Item>

                <Form.Item wrapperCol={{ span: 12, offset: 6 }}>
                    <Button type="primary" htmlType="submit">
                        Submit
                    </Button>
                </Form.Item>
            </Form>
        )
    }
}

export default connect(
    state => ({}),
    {}
)(GISubmit)
